import { useState } from 'react'

const AdminUser = () => {
    const [category, setCategory]=useState('')

    

  return (
    <div>
        <h1>Add Category</h1>
        <form>
            <input type= "text" name="category" onChange={(e)=>{setCategory(e.target.value)}} value={category}></input>
        </form>
    </div>
  )
}

export default AdminUser
